//React
import React from "react";
//Bootstrap Components
import { Col, Container, Row } from "react-bootstrap";
import {Button, Alert} from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <Container>
        <Alert variant='secondary'>This is an alert!</Alert>
        <Row>
          <Col>
          <h1>Aa Hello World!</h1>
          <Button variant="primary">Primary</Button>{' '}
          </Col>
          <Col>
          <h1>Hello World!</h1>
          <Button variant="primary">Primary</Button>{' '}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
